window.bookSummaryJSON = "<p>Alien spies, bloody politics, and apocalyptic world war action in this stunning conclusion to the Lives of Tao trilogy. </p><p>Five years have passed since the events in <i>The Deaths of Tao</i>. The world is split into pro-Prophus and pro-Genjix factions and is poised on the edge of a devastating new world war. A Genjix scientist who defects to the other side holds the key to preventing bloodshed on an almost unimaginable scale. </p><p>With the might of the Genjix in active pursuit, Roen is the only person who can help him save the world, and the Quasing race, too. And you thought you were having a stressful day.... </p>"; 
